    return (
        <section className="hero">
            <nav>
                <h2>Welcome</h2>
                <button onClick={handleLogout}>Logout</button>
                <nav>
         <ul>
           <li>
             <Link to ="/">Home</Link>
           </li>
         </ul>
       </nav>
            </nav>
            <div className="container">

            </div>
        </section>
    )
}

